script: |
  super -f text -I q5444.spq | sort > q5444.out

inputs:
  - name: q5444.spq
    data: |
      SELECT - - col0 + - ( - col1 ), 70 * + col0 * - - col2 AS col0, - 7 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( NULL ) NOT BETWEEN + col2 AND NULL;
  - name: tab1

outputs:
  - name: q5444.out
    data: |
